'''Trần Công Trường''' (sinh năm 1958) là một Thiếu tướng Công an nhân dân Việt Nam. Ông hiện đang là Phó Cục trưởng Cục An ninh mạng, Bộ Công an.

==Thân thế sự nghiệp==
* Quê ông ở xã Đức Thanh (nay thuộc xã [[Thanh Bình Thịnh]]), huyện [[Đức Thọ]], tỉnh [[Hà Tĩnh]].
* Giữ chức Giám đốc Công an tỉnh Hà Tĩnh năm [[2014]]<ref>[http://www.sggp.org.vn/chinhtri/nhansumoi/2014/3/341883/ Bổ nhiệm lãnh đạo Công an tỉnh Hà Tĩnh ]</ref>.
* Giữ chức vụ Phó [[Cục An ninh mạng, Bộ Công an (Việt Nam)|Cục trưởng Cục An ninh mạng, Bộ Công an]] vào ngày [[27 tháng 5]] năm [[2015]]<ref>[http://www.sggp.org.vn/chinhtri/nhansumoi/2015/6/385895/ Đại tá Lê Văn Sao giữ chức Giám đốc Công an tỉnh Hà Tĩnh ]</ref>.

